import { Platform, StyleSheet } from "react-native";

const styles = StyleSheet.create({
    noRecordContainer: {
        alignItems: "center",
        width: "100%",
        marginTop: 10,
    },

    noRecordText: {
        fontSize: 20,
        fontWeight: "bold"
    },
    emptySection:{
        alignContent: 'center',
        alignItems:'center',
        justifyContent:'center',    
    },
    emptyIcon:{
        paddingTop:50,
        alignSelf:'center', 
        justifyContent:'center',
        color: (Platform.OS === 'ios') ? "#FAFAFA" : "#F4F4F4"
    },
});

export default styles;
